                                             else dims_col_rtName||'',高压直流电源所属机房是否存在'' end)
                 where isNotNull(related_room) and not exists(select 1 from RM_AREA_ROOM t2 where t2.int_id=t1.related_room)', 1, 'admin', 'admin', 'PROC_DH_CHECKONERELEVANCYINDEX', 900000008, 1, null);

