values (905000423, '客户编号在系统内是否唯一', 'DIMS_EB_02101', 2101, 905000001, '集客', 11, null, 'update EB_CUSTOMER t1
                   set dims_col_result=(case when dims_col_result like ''%DIMS_EB_02101%'' then dims_col_result
                                             when dims_col_result is null then ''DIMS_EB_02101''
                                             else dims_col_result||'',DIMS_EB_02101'' end),
                       dims_col_rtName=(case when dims_col_rtName like ''%客户编号在系统内是否唯一%'' then dims_col_rtName
                                             when dims_col_rtName is null then ''不满足规范:客户编号在系统内是否唯一''
                                             else dims_col_rtName||'',客户编号在系统内是否唯一'' end)
                 where exists(select 1
		                          from EB_CUSTOMER t2
		                         where t2.ctid <> t1.ctid
		                           and t2.customer_code=t1.customer_code)', 1, 'admin', 'admin', 'PROC_CHECKONEDYNAMICSQLINDEX', 905000001, 1, null);

